import { createContext, useState } from "react";

const UploadCreatedMemeContext = createContext();

function UploadCreatedMemeContextProvider({children}){
    const [uploadCreatedMeme, setUploadCreatedMeme] = useState({});

    return (
        <UploadCreatedMemeContext.Provider value={[uploadCreatedMeme, setUploadCreatedMeme]}>
            {children}    
        </UploadCreatedMemeContext.Provider>
    );
};

export {UploadCreatedMemeContext, UploadCreatedMemeContextProvider};
